{'geocode_type': 'EVDB Geocoder', 'event_count': '324', 'trackback_count': '0', 'comment_count': '4', 'region_abbr': 'PA', 'postal_code': '15222', 'latitude': '40.443022', 'url': 'http://pittsburgh.eventful.com/venues/benedum-center-/V0-001-000313612-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', 'id': 'V0-001-000313612-9', 'address': '237 7th St', 'city_name': 'Pittsburgh', 'owner': 'MauraMc', 'link_count': '2', 'country_name': 'United States', 'longitude': '-79.9998397', 'timezone': None, 'country_abbr': 'USA', 'region_name': 'Pennsylvania', 'country_abbr2': 'US', 'name': 'Benedum Center', 'description': 'The Benedum Center for the Performing Arts is the most popular venue in Pittsburgh&#39;s Cultural District, and has a rich history of entertaining the city&#39;s residents.  Not only is the historic theater home to the Pittsburgh&#39;s Opera, Ballet Theatre, Symphony, and Civic Light Opera, but it also schedules some of the biggest names in music who continue to stop by year after year.  The Benedeum Center is one of the most popular places in Pittsburgh for music and performing arts, and has become beloved by audiences yearning to be entertained.

The concert hall was originally built as a movie palace called the Stanley Theatre in 1928.  At the time, it was the largest movie theater in Western Pennsylvania and entertained audiences throughout the depression.  The Stanley Theatre was turned into a music venue in 1997 and scheduled rock bands like The Grateful Dead and Bob Marley, who performed his very last live concert at the concert hall.  After massive renovations in 1987, the venue was turned into a full performing arts center, retaining its original 4,700 pound chandelier.  Since that time, the Benedum Center for the Performing Arts has combined its legacy of mainstream music with the performing arts to provide audiences with a popular, multi-faceted venue.

Fans of the ballet, theater, orchestra, symphony, and mainstream acts have come to call the Benedum Center for the Performing Arts home.  Check the schedule above to see upcoming performers at the concert hall and prepare for a night of unparalleled entertainment.', 'image': {'small': {'width': '48', 'url': 'http://d1marr3m5x4iac.cloudfront.net/images/small/I0-001/000/571/739-9.png_/benedum-center-39.png', 'height': '48'}, 'width': '48', 'caption': None, 'medium': {'width': '128', 'url': 'http://d1marr3m5x4iac.cloudfront.net/images/medium/I0-001/000/571/739-9.png_/benedum-center-39.png', 'height': '128'}, 'url': 'http://d1marr3m5x4iac.cloudfront.net/images/small/I0-001/000/571/739-9.png_/benedum-center-39.png', 'thumb': {'width': '48', 'url': 'http://d1marr3m5x4iac.cloudfront.net/images/thumb/I0-001/000/571/739-9.png_/benedum-center-39.png', 'height': '48'}, 'height': '48'}, 'created': None, 'venue_type': 'Concert Hall', 'venue_name': 'Benedum Center'}

{'geocode_type': 'EVDB Geocoder', 'event_count': '82', 'trackback_count': '0', 'comment_count': '0', 'region_abbr': 'PA', 'postal_code': '15212', 'latitude': '40.4468548', 'url': 'http://pittsburgh.eventful.com/venues/pnc-park-/V0-001-001329081-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', 'id': 'V0-001-001329081-5', 'address': '115 Federal Street', 'city_name': 'Pittsburgh', 'owner': 'MauraMc', 'link_count': '5', 'country_name': 'United States', 'longitude': '-80.0056657', 'timezone': None, 'country_abbr': 'USA', 'region_name': 'Pennsylvania', 'country_abbr2': 'US', 'name': 'PNC Park', 'description': 'PNC Park Pittsburg opened March 31 2001, and is the current home of the Pittsburg Pirates Major League Baseball team. A classic-style ballpark with a natural grass playing field, the PNC Park Pittsburg has a seating capacity of 38,362 for baseball games - the second smallest capacity of any major league park. However, good things come in small packages, and since its completion, PNC Park Pittsburg has been hailed as one of the best ballparks in the country.

The venue is no one-trick pony either. In addition to baseball, the PNC Park schedule has also featured and is capable of featuring an array of events from corporate meetings and wedding receptions, to bar/bat mitzvahs, fundraisers and more. Indeed, PNC Park has been the location for various concerts by artists including The Rolling Stones and Pearl Jam. The venue has been officially smoke-free since 2007, when Allegheny County passed a ban on smoking in most public places. 

